

#!/bin/bash

# Set current directory to the directory this script is in
SCRIPT=$(readlink -f "$0")
SCRIPT_DIR=$(dirname "$SCRIPT")
cd $SCRIPT_DIR

PROPOSAL="(record {
        title = \"Update ICFC SNS Token Info \";
        url = \"https://github.com/jamesbeadle/icfc\";
        summary = \"Update ICFC SNS Token Info \";
        action = opt variant {
            ManageLedgerParameters  = record {
                token_symbol = opt \"ICFC\";
                token_logo = opt \"data:image/png;base64,\";
                token_name = opt \"ICFC\";
                transfer_fee = opt 100_000;
            }
        }
 })"

../../utils/submit_proposal.sh "$PROPOSAL"